Movie Info: Memories is a 2013 Malayalam psychological thriller film written and directed by Jeethu Joseph starring Prithviraj in the lead role. While the supporting roles are played by Rahul Madhav, Vijayaraghavan, Suresh Krishna, Sreekumar, Mia George,Jeena Riju and Meghana Raj. The film is produced by P K Muralidharan and Santha Murali under the banner of Anantha Visions.



